law.text:
The Commissioner of the Kentucky Department of Agriculture shall submit an annual report to the Interim Joint Committee on Health and Welfare and the Interim Joint Committee on Agriculture, which includes but is not limited to:
The amount of funding received for the Kentucky Farmers Market Nutrition Program;
The economic impact of the program;
Strategies implemented to market the program and improve nutrition; and
Statistics related to the number of individuals served and farmers' markets participating in the program.
